import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import "./App.css";
// components
import Index from "./components/index";
import Loginclient from "./components/login/";
function App() {
  return (
    <Provider store={store}>
      <div>
        <Loginclient />
        <Index />
      </div>
    </Provider>
  );
}

export default App;
